import React from 'react';
import logo from './logo.svg';
import SearchBar from './SearchBar.js';
import ListItem from './ListItem.js';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <SearchBar />
        <ListItem poster="https://images-na.ssl-images-amazon.com/images/I/61kspyBEsNL._SY679_.jpg" />
      </header>
    </div>
  );
}

export default App;
